on, and @baddieblashes. \u6ca1\u6709\u7167\u7247\u63cf\u8ff0\u3002"}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2265633692735249851","edge_media_to_caption":{"edges":[{"node":{"text":"Day 2/100 #100daysofpractice Today I revisited Paolo Longinotti\u2019s Etude #1 \ud83c\udfba\ud83c\udfba I last practiced this 20 years ago for my lessons with David Bilger at @curtisinstitute I remember his instructions on phrasing, dynamics, and clarity in the mid-low range. Coming back in shape, I plan to keep my embouchure more stable in the mid-low range and do more fundamentals in the mid-range. I also have started singing full voice in between phrases (sounds amazing \ud83e\udd23) with a deep voice and very full sound, singing EEE as taught from Armando Ghitalla second hand from @dashtrpt My main goal during #coronavirus #covid_19 quarantine is to GO FOR THE MUSIC and be the bravest I can be with the phrases and stop playing it safe. Happy practicing, everyone!! *\n*\n*\n*\n#longinotti #etude #practice  #yamaha #iplayyamaha #trumpet #trumpets #trumpetplayer #trumpetchallenge #trumpetlife #music #trompette #classicalmusic #musician #love #orchestra #concert  #instamusic  #musical #videooftheday #musicvideo #maryelizabethbowden #marybowden #soloist #womeninmusic #entrepreneurship @yamahamusicusa @yamaha.bandandorchestra @yamahamusiceurope @tonalenergy @shenandoahtrumpetstudio"}}]},"shortcode":"B9xJdb2pB27","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584304604,"dimensions":{"height":421,"width":750},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89827543_233929797737785_6455703065337477275_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=101\u0026_nc_ohc=NjeTB4_0bIAAX8GKpZb\u0026oh=06ab6f3a8a0e6b7cd572d74e00fff6e0\u0026oe=5E7128F7","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"300832565"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c157.0. books. Even if the love isn't real, at least for a moment, it can be in my head.\nCarnations are my favorite flower.\nI wouldn't exchange pain, for a life of \"what-if\". Regrets are for cowards; and that, I am not.\nMy tattoos are my autobiography. \nI surround myself with people of substance; people who have a story to tell through the scars that they wear. I don't want perfect or pretty; I want messy and genuine.\nDespite how far I stray and how horrible of an example I am for a Christian, I believe in God and His plan.\nI see the best in people, even when they don't see it in themselves. It is both a blessing and a curse to my heart.\nI give until there is nothing left to give and then... I, somehow, find more to give. \nI want to be remembered... but, I haven't figured out what I want to be remembered for.\n#himynameis #letstellastory #wallflower #asmilewithoutteethisntreal #hopelessromantic #love #carnations #livealifeofohwellsnotalifeofwhatifs #regretsareforcowards #tattooedautobiography #tattoo #ink #tattooedgirls #inkedgirls #peopleofsubstance #scars #Christian #ablessingandacurse"}}]},"shortcode":"B9xJdEGJo21","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584304601,"dimensions":{"height":864,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89828520_489729971694814_8791267785561208231_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=faaVYn0ydqAAX9sQDXS\u0026oh=0c58d292c27fc957718aee3ec8b1b1da\u0026oe=5EA4C5B6","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"361818219"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c144.0.1152.1152a/s640x640/89828520_489729971694814_8791267785561208231_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=faaVYn0ydqAAX9sQDXS\u0026oh=9962f06ee4c2ce80f7bc185ff0e3487c\u0026oe=5EA19F0D","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagr scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=5xie0LB7vz4AX_RrH1R\u0026oh=42f203cecd78e99e2eb412cc6f343265\u0026oe=5E9A4E6E","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/87422697_220910012391594_7172324410847188312_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=5xie0LB7vz4AX_RrH1R\u0026oh=acb53552c745b410155e5eee8fc28e2d\u0026oe=5EA66024","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/87422697_220910012391594_7172324410847188312_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=5xie0LB7vz4AX_RrH1R\u0026oh=fa37f9e925a3ce7a9330bf911bda91a3\u0026oe=5E9C8C9E","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s480x480/87422697_220910012391594_7172324410847188312_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=5xie0LB7vz4AX_RrH1R\u0026oh=8b89c1a5d690ca9e62a524843d4faf14\u0026oe=5EA2F2C4","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/87422697_220910012391594_7172324410847188312_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=5xie0LB7vz4AX_RrH1R\u0026oh=f3353a976b6ee483f98215d96e37d2b1\u0026oe=5E9E78C9","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"Photo by Pablo C\u00e9sar on March 10, 2020. \u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2257518615725827761","edge_media_to_caption":{"edges":[{"node":{"text":"J\u2019ai le sentiment que l\u2019on a tendance \u00e0 toujours survaloriser la maternit\u00e9 et \u00e0 en dire des choses exclusivement positives.\nEt c\u2019est une r\u00e9alit\u00e9. La maternit\u00e9 est, selon moi, et \u00e0 titre personnel, le plus beau r\u00f4le d\u2019une vie.\n.\nNous lisons, entendons rarement qu\u2019etre parent c\u2019est difficile.\nIl y a des jours o\u00f9 personnellement je me noie, je me sens compl\u00e8tement d\u00e9pass\u00e9e par leurs \u00e9motions qu\u2019ils m\u2019envoient au visage et sans filtres. .\nJe ne montre que des moments joyeux ici, car je ne souhaite pas publier des images de mes fils en d\u00e9tresse mais plut\u00f4t \u00eatre \u00e0 leurs c\u00f4t\u00e9s pour les accompagner. De plus, je garde en t\u00eate que les difficult\u00e9s sont provisoires. .\nEn tant que parent, on absorbe toutes les \u00e9motions de nos enfants, mais il est important de les accompagner \u00e0 les accueillir, et d\u2019accueillir nos propres \u00e9motions. .\nNous rencontrons tous notre lot de difficult\u00e9s, nos moments sombres, nos doutes et nos moments de joie. \nAlors \u00e0 toi jeune maman, \u00e0 toi maman plus exp\u00e9riment\u00e9e , \u00e0 toi qui donne le biberon, \u00e0 toi qui allaite, \u00e0 toi maman stress\u00e9e, \u00e0 toi qui dort avec ton b\u00e9b\u00e9, \u00e0 toi qui pleure, \u00e0 toi qui craque, \u00e0 toi qui a des kilos en moins ou en trop, \u00e0 tes vergetures, \u00e0 toi qui cuisine bio ou pas, \u00e0 toi qui ne publie pas de photos Insta2.0, \u00e0 toi qui adore \u00eatre enceinte, \u00e0 toi qui esp\u00e8re accoucher \u00e0 37sa, \u00e0 toi, \u00e0 nous, \u00e0 toutes les mamans, rappelons-nous que l\u2019herbe n\u2019est pas plus verte ailleurs.\n.\nAcceptons, accueillons nos \u00e9motions telles qu\u2019elles sont.\nCe n\u2019est pas parce que l\u2019on d\u00e9cide d\u2019avoir un enfant que l\u2019on doit adorer \u00eatre enceinte.\nCe n\u2019est pas parce que l\u2019on a voulu un enfant que l\u2019on doit se r\u00e9jouir des d\u00e9sagr\u00e9ments que provoque la grossesse.\nCe n\u2019est pas parce que l\u2019on a la chance d\u2019\u00eatre parent que l\u2019on ne peut pas exprimer sa fatigue , sa col\u00e8re, ses angoisses.\nNe r\u00e9primons pas nos \u00e9motions .\nLa vraie vie est celle que l\u2019on vit, et non pas les quelques minutes que l\u2019on d\u00e9cide de publier.\n.\nLa maternit\u00e9 est une aventure merveilleuse et magnifique.\nEt je me sens particuli\u00e8rement chanceuse de la vivre.\n.\nJe d\u00e9cide simplement d\u2019\u00eatre transparente.\nMalgr\u00e9 l\u2019intense bonheur que l\u2019on vit, ce n\u2019est pas tout rose. C\u2019est la vie. Tout simplement. \ud83d\udda4"}}]},"shortcode":"B9UUThcK2ax","edge_media_to_comment":{"count":53},"taken_at_timestamp":1583337212,"dimensions":{"height":843,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/87437707_809389342883675_3437208539021369401_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=NRt_sLlDyjkAX9ikevH\u0026oh=129aeb08399de16c58e554aa6be1c6e1\u0026oe=5EA2515B","edge_liked_by":{"count":328},"edge_media_preview_like":{"count":328},"owner":{"id":"1512463158"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c157.0.1125.1125a/s640x640/87437707_809389342883675_3437208539021369401_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=NRt_sLlDyjkAX9ikevH\u0026oh=5e4c06f78fbbd4b35f480e5d8222cd9f\u0026oe=5E9F43F3","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c157.0.1125.1125a/s150x150/87437707_809389342883675_3437208539021369401_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=NRt_sLlDyjkAX9ikevH\u0026oh=504b0397e49bcbd428d8ee9ae0425fbc\u0026oe=5EA60E38","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c157.0.1125.1125a/s240x240/87437707_809389342883675_3437208539021369401_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=111\u0026_nc_ohc=NRt_sLlDyjkAX9ikevH\u0026oh=5ce9425eb30b69e62c1784e6071bd0c2\u0026oe=5EA5A072","config_width":240,"config_height":240},{"src":"https://scontent
